storage_v1beta1_csi_driver_definition() ->
  {object,
   #{members =>
       #{spec =>
           {ref, storage_v1beta1_csi_driver_spec},
         metadata =>
           {ref, apimachinery_apis_meta_v1_object_meta},
         kind =>
           string,
         apiVersion =>
           string},
     required =>
       [spec]}}.

